  null,\n\t\"notes\": \"<p>The current status of HOME activities by program year and
  includes committed amount and drawn amount. This is a quick reference to see the
  status of HOME activities for a given year and is a quick glance to see what activities
  are ready to close. from Integrated Disbursement and Information System (IDIS) -
  A mandatory system used to track projects funded by HUD grants (CDBG, ESG, HOPWA
  and HOME funds).  Commitments of these funds are shown through entries made into
  this system.  Reports can be generated from this system and HUD monitors the performance
  of the funded projects from this source.</p>n\",\n\t\"owner_org\": \"72add7c8-b5ff-4e2e-9fa8-ee9d72e25038\",\n\t\"extras\":
